const channel = {
  volume: 0,
  mute: false
}

const synth = {
  volume: 10,
  detune: 0,
  portamento: 0.05,
  envelope: {
    attack: 0.05,
    attackCurve: 'exponential',
    decay: 0.2,
    decayCurve: 'exponential',
    sustain: 0.2,
    release: 1.5,
    releaseCurve: 'exponential'
  },
  oscillator: {
    type: 'sine', // "fatsine" | "fatsquare" | "fatsawtooth" | "fattriangle" | "fatcustom" | FatTypeWithPartials | "fmsine" | "fmsquare" | "fmsawtooth" | "fmtriangle" | "fmcustom" | FMTypeWithPartials | "amsine" | "amsquare" | "amsawtooth" | "amtriangle" | "amcustom" | AMTypeWithPartials | TypeWithPartials | OscillatorType | "pulse" | "pwm"
    modulationType: 'sine',
    // partialCount: 0,
    // partials: [],
    phase: 0,
    harmonicity: 0.5
  }
}

const freeverb = {
  wet: 0.3,
  roomSize: 0.3,
  dampening: 50
}

const sequence = {
  steps: [
    {
      time: '0:0:0',
      noteName: 'A1',
      duration: '4n',
      velocity: 1
    },
    {
      time: '0:1:0',
      noteName: 'A2',
      duration: '4n',
      velocity: 1
    },
    {
      time: '0:2:0',
      noteName: 'A1',
      duration: '4n',
      velocity: 1
    },
    {
      time: '0:3:0',
      noteName: 'A2',
      duration: '4n',
      velocity: 1
    }
  ],
  duration: '1m'
}

export { channel, synth, freeverb, sequence }
